import * as Font from 'expo-font';
import { Ionicons } from '@expo/vector-icons';

const App = () => {
  const [isReady, setIsReady] = useState(false);

  useEffect(() => {
    // loadData();
  }, []);

  return !isReady ? (
    <AppLoading />
  ) : (
    <Container>
      <Text>Open up App.js to start working on your app!</Text>
    </Container>
  );
};

export default App;
